  return (
    <div>
      <BrowserRouter>
        <Routes>
          {/* <Route exact path={BaseURL} element={<Home />} /> */}
          {/* <Route path="*" element={<div>Aqui no hay nada</div>} /> */}
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default injectContext(App);
